window.bookSummaryJSON = "<p>When half your galaxy is unexpectedly sucked into a black hole - when a hitherto-unknown species of space aliens lays waste to your home planet - when disaster rears its ugly head (or heads) - who can you call for faster-than-light appraisals and best-in-the-multiverse customer service? Just one man - Tom Stranger, Interdimensional Insurance Agent.&nbsp;</p> <p>In this latest chapter of his interstellar exploits, Tom is about to deliver a crushing performance evaluation to Jimmy the Intern when the unimaginable happens: The beloved Wendell the Manatee has been kidnapped! Armed with his battle mechs and his elite corps of junior associates, can Tom find Wendell before he's canned in oil? And can Jimmy, at long last, channel his inner agent?&nbsp;</p> <p>Performed by Adam Baldwin, the sci-fi Audible Original <i>A Murder of Manatees</i> will make you quiver with fear, laugh uncontrollably, and wonder whether your deductibles are too high.&nbsp;</p>"; 
